import { ReactDOM, useState, useEffect } from "react";
import logo from "../assets/logo1.png";

function ResetPassword({ theme, toggleTheme }) {
  return (
    <>
      {/* NavBar */}
      <div className="fixed navbar z-50 bg-base-100">
        <div className="flex-1 navbar-start">
          <a className="btn btn-ghost lg:text-xl sm:text-md">
            <img className="h-7 w-7 bg-contain  " src={logo} />
            Pugad Maharlika
          </a>
        </div>
        <div className="navbar-center hidden lg:flex"></div>
        <div className="flex-1 gap-3 navbar-end">
          <button onClick={toggleTheme} className="btn btn-square btn-outline">
            {theme === "night" ? (
              <i className="fa-regular fa-moon"></i>
            ) : (
              <i className="fa-regular fa-sun"></i>
            )}
          </button>
        </div>
      </div>
      {/* HERO SECTION */}
      <section id="home" className="flex w-full flex-col">
        <div className="h-8 "></div>
        <div className="grid max-w-screen-xl px-4 py-8 mx-auto lg:gap-8 xl:gap-0 lg:py-16 lg:grid-cols-12">
          <div className="flex lg:mt-0 lg:col-span-5 lg:hidden">
            <img src={logo} alt="mockup" />
          </div>
          <div className="mr-auto place-self-center lg:col-span-7 ">asdasdasd</div>
          <div className="hidden lg:mt-0 lg:col-span-5 lg:flex">
            <img src={logo} alt="mockup" />
          </div>
        </div>
      </section>
    </>
  );
}

export default ResetPassword;
